
#import "NSString+BankInfo.h"
#import "UIColor+PY.h"

@implementation NSString (BankInfo)

#define CardTypeMap @{@"DC":@"储蓄卡",@"CC":@"信用卡",@"SCC":@"准贷记卡",@"PC":@"预付费卡"}


- (BOOL)isPureNumandCharacters:(NSString *)string {
    string = [string stringByTrimmingCharactersInSet:[NSCharacterSet decimalDigitCharacterSet]];
    if(string.length > 0) {
        return NO;
    }
    return YES;
}

- (BOOL)isValidateString:(NSString *)str forRegularRegex:(NSString *)regularRegex {
    NSPredicate *regularTest = [NSPredicate predicateWithFormat:@"SELF MATCHES %@", regularRegex];
    return [regularTest evaluateWithObject:str];
}

- (NSDictionary *)getBankInfoByBankCode {
    NSArray *bankArray = self.getBankArray;
    for (NSDictionary *bankDic in bankArray) {
        for (NSDictionary *bankInfo in bankDic[@"patterns"]) {
            if([self isValidateString:self forRegularRegex:bankInfo[@"reg"]]) {
                return @{
                         @"bankName": bankDic[@"bankName"],
                         @"bankCode": bankDic[@"bankCode"],
                         @"cardType": bankInfo[@"cardType"],
                         @"cardDescription": CardTypeMap[bankInfo[@"cardType"]]
                         };
            }
        }
    }
    return @{};
}

- (NSString *)getBankcardTypeDescription {
    return [self getBankInfo][@"cardDescription"];
}

- (NSDictionary *)getBankInfo {
    if (![self isPureNumandCharacters:self]) {
        NSLog(@"银行卡号必须是纯数字");
        return nil;
    }
    
    if (self.length < 15 || self.length > 19) {
        NSLog(@"银行卡位数必须是15到19位");
        return nil;
    }
    
    NSDictionary *info = [self getBankInfoByBankCode];
    NSLog(@"%@", [NSString stringWithCString:[info.description cStringUsingEncoding:NSUTF8StringEncoding] encoding:NSNonLossyASCIIStringEncoding]);
    return info;
}

